  return (
    <Col md={4}>
      <Card style={{ width: 330 }} border="secondary" className="pt-1 py mb-4">
        <Image width={320} height={300} src={product.image} /*{className="mx-1 my-1 "}*/ />
        <div>ЗАЛУПА</div>
      </Card>
    </Col>
  );
};

export default ProductItem;
